  `Activo_Curso_Comprados` tinyint(1) DEFAULT '1',
  PRIMARY KEY (`Usuario`,`Curso`,`Costo`,`Titulo`),
  KEY `Usuario_Nombre` (`Usuario_Nombre`),
  KEY `Usuario_Nombre_Paterno` (`Usuario_Nombre_Paterno`),
