  CONSTRAINT `curso_comprados_ibfk_2` FOREIGN KEY (`Usuario_Nombre`) REFERENCES `usuario` (`Nombre_Usuario`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `curso_comprados_ibfk_3` FOREIGN KEY (`Usuario_Nombre_Paterno`) REFERENCES `usuario` (`NomPatr_Usuario`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `curso_comprados_ibfk_4` FOREIGN KEY (`Usuario_Nombre_Materno`) REFERENCES `usuario` (`NomMatr_Usuario`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `curso_comprados_ibfk_5` FOREIGN KEY (`Curso`) REFERENCES `curso` (`ID_Curso`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `curso_comprados_ibfk_6` FOREIGN KEY (`Costo`) REFERENCES `curso` (`Costo_Curso`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `curso_comprados_ibfk_7` FOREIGN KEY (`Titulo`) REFERENCES `curso` (`Titulo_Curso`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
